inline unsigned int rotate_left(const unsigned int x, const unsigned n)
{
	return (x << n) | (x >> (32 - n));
}
inline unsigned int rotate_right(const unsigned int x, const unsigned n)
{
	return (x >> n) | (x << (32 - n));
}
inline int hw(uint32_t w) {
	int cout = 0, temp;
	temp = w;
	for (int i = 0; i <= 31; i++)
	{
		if (temp & 1)
		{
			cout++;
		}

		temp = temp >> 1;
	}
	return cout;
}
inline void sha1_me_generalised(uint32_t block[80], unsigned offset)
{
	int i;
	for (i = offset + 16; i < 80; ++i)
		block[i] = rotate_left(block[i - 3] ^ block[i - 8] ^ block[i - 14] ^ block[i - 16], 1);
	for (i = int(offset) - 1; i >= 0; --i)
		block[i] = rotate_right(block[i + 16], 1) ^ block[i + 13] ^ block[i + 8] ^ block[i + 2];
}








